import React from "react";
import { NavLink } from "react-router-dom";
import "./Nav.css";

const Nav = () => {
    return(
        <nav>
            <NavLink to href="/oleg">Oleg</NavLink>
            <a href="/oleg">Oleg</a>
            <a href="/maxim">Maxim</a>
            <a href="#">Link</a>
            <a href="#">Link</a>
            <a href="#">Link</a>
        </nav>
    )
}
export default Nav;
